import React from 'react';

const NavBar = () => {
    return (
        <nav className="navbar">
            <h1>Secret Werewolf</h1>
            <div className="links">
                <a href='/'>Home</a>
                <a href='/listaccounts'>Leaderboard</a>
                <a href='/accountdetails'>My Account</a>
                <a href='/signin'>Sign In</a>
                <a href='/signup'>Sign up</a>
            </div>
        </nav>
    );
}

export default NavBar;
